import React from 'react'
import CardItem from './CardItem'
import { Col, Container, Row } from 'react-bootstrap'


const Home = () => {

    const data = [
        {
            id: '1',
            name: 'rick shancez',
            image: 'Pic',
            species: 'human',
            location: {
                'name': 'Earth (Replacement Dimension)'
            }
        },

        {
            id: '2',
            name: 'Bro Tony',
            image: 'Pic',
            species: 'Mamalia',
            location: {
                'name': 'Jupiters (Jonasd Dimension)'
            }
        },

        {
            id: '3',
            name: 'Anjai Sarungga',
            image: 'Pic',
            species: 'Fish',
            location: {
                'name': 'Mars (Junars Dimension)'
            }
        },

        {
            id: '4',
            name: 'Tony Stark',
            image: 'Pic',
            species: 'Iron Man',
            location: {
                'name': 'Saturnus (Avengers Dimension)'
            }
        }
    ]

  return (
    <div className='mx-auto'>
        <Container>
            <Row>
                <Col className='mt-3'><CardItem/></Col>     
                <Col className='mt-3'><CardItem/></Col>     
                <Col className='mt-3'><CardItem/></Col>     
                <Col className='mt-3'><CardItem/></Col>    
                <Col className='mt-3'><CardItem/></Col>     
                <Col className='mt-3'><CardItem/></Col>    
            </Row>
        </Container>
    </div>
  )
}

export default Home
